csharp.source:
Vpc vpc;


// Create an ECS cluster
Cluster cluster = new Cluster(this, "Cluster", new ClusterProps {
    Vpc = vpc
});

// Add capacity to it
cluster.AddCapacity("DefaultAutoScalingGroupCapacity", new AddCapacityOptions {
    InstanceType = new InstanceType("t2.xlarge"),
    DesiredCapacity = 3
});

Ec2TaskDefinition taskDefinition = new Ec2TaskDefinition(this, "TaskDef");

taskDefinition.AddContainer("DefaultContainer", new ContainerDefinitionOptions {
    Image = ContainerImage.FromRegistry("amazon/amazon-ecs-sample"),
    MemoryLimitMiB = 512
});

// Instantiate an Amazon ECS Service
Ec2Service ecsService = new Ec2Service(this, "Service", new Ec2ServiceProps {
    Cluster = cluster,
    TaskDefinition = taskDefinition
});

java.source:
Vpc vpc;


// Create an ECS cluster
Cluster cluster = Cluster.Builder.create(this, "Cluster")
        .vpc(vpc)
        .build();

// Add capacity to it
cluster.addCapacity("DefaultAutoScalingGroupCapacity", AddCapacityOptions.builder()
        .instanceType(new InstanceType("t2.xlarge"))
        .desiredCapacity(3)
        .build());

Ec2TaskDefinition taskDefinition = new Ec2TaskDefinition(this, "TaskDef");

taskDefinition.addContainer("DefaultContainer", ContainerDefinitionOptions.builder()
        .image(ContainerImage.fromRegistry("amazon/amazon-ecs-sample"))
        .memoryLimitMiB(512)
        .build());

// Instantiate an Amazon ECS Service
Ec2Service ecsService = Ec2Service.Builder.create(this, "Service")
        .cluster(cluster)
        .taskDefinition(taskDefinition)
        .build();

