        .image(ContainerImage.fromAsset(resolve(__dirname, "..", "eventhandler-image")))
        .memoryLimitMiB(256)
        .logging(AwsLogDriver.Builder.create().streamPrefix("EventDemo").mode(AwsLogDriverMode.NON_BLOCKING).build())
